    <style>
        .content {
            position: absolute;
            left: 50%;
            top: 50%;
            -webkit-transform: translate(-50%, -50%);
            transform: translate(-50%, -50%);
            text-align: center;
            
            font-family: 'Poppins', sans-serif;
        }

        p {
            margin: 0;
        }

        body {
            background-color: #3b3b3b;
            margin: 0;
        }

        .btn {
            display: inline-block;
            background-color: rgb(151, 151, 151);
            border-radius: 15px;
            font-size: 35px;
            color: rgb(51, 51, 51);
            margin-top: 100px;
            width: 170px;
            border: 1px solid rgb(75, 75, 75);
        }

        a {
            opacity: 0.6;
            transition: 0.3s;
        }

        a:hover {
            opacity: 1;
        }

        a:link {
            text-decoration: none;
        }

        a:visited {
            text-decoration: none;
        }

        @keyframes loadanim {
            0% {
                opacity: 0;
            }
            100% {
                opacity: 100%;
            }
        }

        .loaded {
            animation: 1s ease-out 0s 1 loadanim;
        }

        #myVideo {
            position: fixed;
            right: 0;
            bottom: 0;
            min-width: 100%;
            min-height: 100%;
        }

        video {
            filter: brightness(30%);
        }

        #myBtn {
            width: 200px;
            font-size: 18px;
            padding: 10px;
            border: none;
            background: #000;
            color: #fff;
            cursor: pointer;
        }

        #myBtn:hover {
            background: #ddd;
            color: black;
        }
    </style>
